const videos = [
	{
		id: 1,
		name: '1',
		duration: 15,
	},
	{
		id: 2,
		name: '2',
		duration: 15,
	},
	{
		id: 1,
		name: '3',
		duration: 15,
	},
	{
		name: '3ad',
		duration: 15,
	},
	{
		name: '3d',
		duration: 15,
	},
	{
		name: '3dasd',
		duration: 15,
	}
]

export function VideoList(){
	return(
		<>
		<h1>Video List!</h1>
			{
				videos.map((video) =>{
					return (
						<div>
							<p>{video.name}</p>
							<p>{video.duration}</p>
							<button>Лайк</button>
						</div>
					)
				})
			}
		</>
		
	)
}
